package db.domain;public class TServerStartTime {	private String serverId;	private String startServerTime;	public TServerStartTime() {	}	public TServerStartTime(TServerStartTime c) {		this.serverId = c.serverId;		this.startServerTime = c.startServerTime;	}	public void setServerId(String serverId) {		this.serverId = serverId;	}	public String getServerId() {		return this.serverId;	}public void addServerId(String serverId) {		this.serverId += serverId;}	public void setStartServerTime(String startServerTime) {		this.startServerTime = startServerTime;	}	public String getStartServerTime() {		return this.startServerTime;	}public void addStartServerTime(String startServerTime) {		this.startServerTime += startServerTime;}}